import React from 'react';
import { Link } from 'react-router-dom';
import mimoticon from '../assets/mimoticon.jpg';

const Main = (props) => {
	return (
		<>
			 <img
				src={mimoticon}
				alt="My Portfolio Preview"
				style={{
				width: '300px',
				height: 'auto',
				borderRadius: '10px',
				boxShadow: '0 4px 10px rgba(0,0,0,0.2)',
				marginTop: '20px'
				}}
			/>
		</>
	);
};

export default Main;
